export async function update(HomeId,params) {
    return connection(TABLE).update(snakeize(params)).where(({id:HomeId}));
  }

/**
 * delete
 * @param {*} homeId 
 */
export async function remove(homeId) {
    return connection(TABLE)
      .delete()
      .where({id: homeId});
  }

