//     return camelize(result);
// }


/**
 * update
 * @param {*} skillsId 
 * @param {*} params 
 */
export async function update(skillsId,params) {
    return connection(TABLE).update(snakeize(params)).where(({id:skillsId}));
  }

  /**
 * delete
 * @param {*} skillsId 
 */
export async function remove(skillsId) {
    return connection(TABLE)
      .delete()
      .where({id: skillsId});
  }

